ExitCodeCheck(){
  lastcode=$1
  if [[ $lastcode > $exitcode ]]
  then
     exitcode=${lastcode}
     #echo exitcode=${exitcode}
  fi
}

configure_cmdline(){
  CMDLINE=$1/cmdline.txt
  #echo \$1=${1} CMDLINE=${CMDLINE}

  if [[ -f ${CMDLINE} ]]
  then
     DONT_EDIT=`grep "^DO NOT EDIT THIS FILE" ${CMDLINE}`
     #echo DONT_EDIT_${CMDLINE}=${DONT_EDIT}
     if [[ "${DONT_EDIT}" == "" ]]
     then
        HAVE_CONSOLE_LOGIN=`grep "console=serial0" ${CMDLINE}`
        #echo HAVE_CONSOLE_LOGIN=${HAVE_CONSOLE_LOGIN}

        if [[ ${HAVE_CONSOLE_LOGIN} != "" ]]
        then
           sed -i s/console=serial[0-9],[0-9]*\ //  "${CMDLINE}"
           ExitCodeCheck $?
           #cat ${CMDLINE}
           #echo
           echo Changed ${CMDLINE}
           NEEDREBOOT=Y
        fi
     fi
  fi
}

configure_config(){
  HAVE_PI4=`cat /proc/cpuinfo | grep Model | grep "Pi 4"`
  BOOTCONFIG=$1/config.txt
  if ischroot; then
     HAVE_PI4="CHROOT"
  fi
  #echo \$1=${1} BOOTCONFIG=${BOOTCONFIG} HAVE_PI4=${HAVE_PI4}
  if [[ "${HAVE_PI4}" != "" ]] && [[ -f ${BOOTCONFIG} ]]; then
     DONT_EDIT=`grep "^DO NOT EDIT THIS FILE" ${BOOTCONFIG}`
     #echo DONT_EDIT_${BOOTCONFIG}=${DONT_EDIT}
     if [[ "${DONT_EDIT}" == "" ]]; then
        HAVE_UART=`grep "^enable_uart=" ${BOOTCONFIG}`
        #echo HAVE_UART=${HAVE_UART}
        ENABLED_UART=`grep "^enable_uart=1" ${BOOTCONFIG}`
        #echo ENABLED_UART=${ENABLED_UART}
        HAVE_MINI_BT=`grep "^dtoverlay=miniuart-bt" ${BOOTCONFIG}`
        #echo HAVE_MINI_BT=${HAVE_MINI_BT}
        HAVE_PPS_GPIO=`grep "^dtoverlay=pps-gpio,gpiopin=18" ${BOOTCONFIG}`
        #echo HAVE_PPS_GPIO=${HAVE_PPS_GPIO}
        HAVE_CORE_FREQ=`grep "^core_freq=250" ${BOOTCONFIG}`
        #echo HAVE_CORE_FREQ=${HAVE_CORE_FREQ}

        START_LINE=0
        while : ; do
           PI4_SECTION=`tail -n+${START_LINE} ${BOOTCONFIG} | awk '/^\[pi4\]/ {print NR+1; exit 0; }'`
           #echo before START_LINE=${START_LINE} PI4_SECTION=${PI4_SECTION}
           if [[ ${PI4_SECTION} != "" ]]; then
              if [[ ${START_LINE} != 0 ]]; then
                 let "PI4_SECTION=${PI4_SECTION}+${START_LINE}-1"
                 #echo after PI4_SECTION=${PI4_SECTION} START_LINE=${START_LINE}
              fi
              NEXT_SECTION=`tail -n+${PI4_SECTION} ${BOOTCONFIG} | awk '/^\[/ {print NR; exit 0; }'`
              #echo NEXT_SECTION=${NEXT_SECTION}
              if [[ ${NEXT_SECTION} == "" ]]; then
                 #echo tail -n+${PI4_SECTION} ${BOOTCONFIG}
                 #tail -n+${PI4_SECTION} ${BOOTCONFIG}
                 HAVE_OTG=`tail -n+${PI4_SECTION} ${BOOTCONFIG} | grep "^otg_mode=1"`
                 break
              else
                 let "NEXT_SECTION=${NEXT_SECTION}-1"
                 #echo tail -n+${PI4_SECTION} ${BOOTCONFIG} \| head -n+${NEXT_SECTION}
                 #tail -n+${PI4_SECTION} ${BOOTCONFIG} | head -n+${NEXT_SECTION}
                 HAVE_OTG=`tail -n+${PI4_SECTION} ${BOOTCONFIG} | head -n+${NEXT_SECTION} | grep "^otg_mode=1"`
              fi
              if [[ ${HAVE_OTG} != "" ]]; then
                 break
              fi
              let "START_LINE=${PI4_SECTION}+${NEXT_SECTION}"
           else
              break
           fi

        done
        #echo after loop HAVE_OTG=${HAVE_OTG}

        if [[ ${HAVE_UART} == "" ]] || [[ ${HAVE_MINI_BT} == "" ]] || [[ ${HAVE_CORE_FREQ} == "" ]]
        then
           echo [all] >> ${BOOTCONFIG}
           echo >> ${BOOTCONFIG}
           CONFIG_CHANGED=Y
           NEEDREBOOT=Y
        fi

        if [[ ${HAVE_UART} == "" ]]
        then
           echo enable_uart=1 >> ${BOOTCONFIG}
           echo Uart0 added to ${BOOTCONFIG}
           CONFIG_CHANGED=Y
           NEEDREBOOT=Y
        elif [[ ${ENABLED_UART} == "" ]]
        then
           sed -i s/^enable_uart=.*/enable_uart=1/  "${BOOTCONFIG}"
           ExitCodeCheck $?
           echo Uart0 enabled at ${BOOTCONFIG}
           CONFIG_CHANGED=Y
           NEEDREBOOT=Y
        fi

        if [[ ${HAVE_MINI_BT} == "" ]]
        then
           echo dtoverlay=miniuart-bt >> ${BOOTCONFIG}
           echo Bluetooth change to miniUART into ${BOOTCONFIG}
           CONFIG_CHANGED=Y
           NEEDREBOOT=Y
        fi

        if [[ ${HAVE_PPS_GPIO} == "" ]]; then
           echo dtoverlay=pps-gpio,gpiopin=18 >> ${BOOTCONFIG}
           echo Add PPS on GPIO 18 into ${BOOTCONFIG}
           CONFIG_CHANGED=Y
           [[ "${ADD_GPIO_REBOOT}" == "YES" ]] && NEEDREBOOT=Y
        fi

        if [[ ${HAVE_CORE_FREQ} == "" ]]
        then
           echo core_freq=250 >> ${BOOTCONFIG}
           echo Core freq added to ${BOOTCONFIG}
           CONFIG_CHANGED=Y
           NEEDREBOOT=Y
        fi

        if [[ ${HAVE_OTG} == "" ]]
        then
           echo [pi4] >> ${BOOTCONFIG}
           echo otg_mode=1 >> ${BOOTCONFIG}
           echo Otg mode added to ${BOOTCONFIG}
           CONFIG_CHANGED=Y
           NEEDREBOOT=Y
        fi
     fi
  fi
}

replace_config(){
  BOOTCONFIG=$1/${CONFIG}
  NEWCONFIG=${BASEDIR}/${CONFIG}
  #echo \$1=${1} BOOTCONFIG=${BOOTCONFIG} NEWCONFIG=${NEWCONFIG}
  if [[ -f ${BOOTCONFIG} ]]
  then
     DONT_EDIT=`grep "^DO NOT EDIT THIS FILE" ${BOOTCONFIG}`
     #echo DONT_EDIT_${BOOTCONFIG}=${DONT_EDIT}
     if [[ "${DONT_EDIT}" == "" ]]
     then
        #echo diff -q ${NEWCONFIG} ${BOOTCONFIG}
        IS_DIFF=`diff -q ${NEWCONFIG} ${BOOTCONFIG}`
        #echo IS_DIFF=${IS_DIFF}
        if [[ "${IS_DIFF}" != "" ]]
        then
           BOOTCONFIG_OLD=${BOOTCONFIG}.old
           #echo cp ${BOOTCONFIG} ${BOOTCONFIG_OLD}
           cp ${BOOTCONFIG} ${BOOTCONFIG_OLD}
           ExitCodeCheck $?
           #echo diff -q ${BASEDIR}/${CONFIG_ORIG} ${BOOTCONFIG}
           IS_ORIG=`diff -q ${BASEDIR}/${CONFIG_ORIG} ${BOOTCONFIG}`
           #echo diff -q ${BASEDIR}/${CONFIG_ORIG2} ${BOOTCONFIG}
           IS_ORIG2=`diff -q ${BASEDIR}/${CONFIG_ORIG2} ${BOOTCONFIG}`
           #echo IS_ORIG=${IS_ORIG} IS_ORIG2=${IS_ORIG2}
           if [[ "${IS_ORIG}" == "" ]] || [[ "${IS_ORIG2}" == "" ]]; then
              #echo mv ${NEWCONFIG} ${BOOTCONFIG}
              mv ${NEWCONFIG} ${BOOTCONFIG}
              ExitCodeCheck $?
              NEEDREBOOT=Y
              echo ${BOOTCONFIG} replaced. Old version in the ${BOOTCONFIG_OLD}
           else
              configure_config $1
              if [[ "${CONFIG_CHANGED}" == "Y" ]]; then
                 echo ${BOOTCONFIG} changed. Old version in the ${BOOTCONFIG_OLD}
              fi
           fi
        else
           echo ${BOOTCONFIG} is already replaced
        fi
     fi
  fi
}

do_configure_config(){
  BOOTCONFIG=$1/${CONFIG}
  #echo \$1=${1} BOOTCONFIG=${BOOTCONFIG}
  if [[ -f ${BOOTCONFIG} ]]; then
     DONT_EDIT=`grep "^DO NOT EDIT THIS FILE" ${BOOTCONFIG}`
     #echo DONT_EDIT_${BOOTCONFIG}=${DONT_EDIT}
     if [[ "${DONT_EDIT}" == "" ]]; then
        BOOTCONFIG_OLD=${BOOTCONFIG}.old
        #echo cp ${BOOTCONFIG} ${BOOTCONFIG_OLD}
        cp ${BOOTCONFIG} ${BOOTCONFIG_OLD}
        ExitCodeCheck $?
        configure_config $1
        if [[ "${CONFIG_CHANGED}" == "Y" ]]; then
           echo ${BOOTCONFIG} changed. Old version in the ${BOOTCONFIG_OLD}
        fi
     fi
  fi
}

delete_all_extracted(){
  if [[ "${FILES_EXTRACT}" != "" ]]
  then
     #echo rm -rf ${FILES_EXTRACT}
     rm -rf ${FILES_EXTRACT}
  fi
}

check_version(){
  echo '################################'
  echo 'CHECK VERSION'
  echo '################################'
  #echo BASEDIR=${BASEDIR} RTKBASE_PATH=${RTKBASE_PATH}
  if [ -f ${RTKBASE_PATH}/${VERSION_FILE} ]; then
     UPDATE=Y
     OLD_VERSION=`cat ${RTKBASE_PATH}/${VERSION_FILE}`
     ExitCodeCheck $?
     #echo NEW_VERSION=${NEW_VERSION} OLD_VERSION=${OLD_VERSION}
     if [ "${NEW_VERSION}" -lt "${OLD_VERSION}" ]
     then
        echo Already installed version'('${OLD_VERSION}')' is newer, than install.sh version'('${NEW_VERSION}')'. Exiting
        delete_all_extracted
        exit 0
     else
        echo Update from version ${OLD_VERSION} to version ${NEW_VERSION}
        if [ -f ${SETTINGS_NOW} ]
        then
           #echo sudo -u "${RTKBASE_USER}" cp ${SETTINGS_NOW} ${SETTINGS_SAVE}
           sudo -u "${RTKBASE_USER}" cp ${SETTINGS_NOW} ${SETTINGS_SAVE}
           ExitCodeCheck $?
        fi
     fi
  else
     echo Install version ${NEW_VERSION}
     OLD_VERSION=${NEW_VERSION}
     UPDATE=N
  fi
  echo ${NEW_VERSION} >${RTKBASE_PATH}/${VERSION_FILE}
}

add_pps_module(){
  MODULES=/etc/modules
  #echo MODULES=${MODULES}
  if [[ -f ${MODULES} ]]; then
     HAVE_PPS_GPIO=`grep "^pps-gpio" ${MODULES}`
     #echo HAVE_PPS_GPIO=${HAVE_PPS_GPIO}
     if [[ ${HAVE_PPS_GPIO} == "" ]]; then
        echo pps-gpio >> ${MODULES}
        echo Add pps-gpio into ${MODULES}
        [[ "${ADD_GPIO_REBOOT}" == "YES" ]] && NEEDREBOOT=Y
     fi
  fi
}

set_permanenet_journals(){
  JOURLAND_CONF=/etc/systemd/journald.conf
  JOURLAND_CONF2=/usr/lib/systemd/journald.conf.d/40-rpi-volatile-storage.conf
  if [[ -f ${JOURLAND_CONF} ]]; then
     if ! grep -q "^Storage=persistent" ${JOURLAND_CONF}; then
        #echo sed -i "s/^Storage=volatile/\#Storage=volatile/" ${JOURLAND_CONF}
        sed -i "s/^\#*Storage=.*/Storage=persistent/" ${JOURLAND_CONF}
        echo Set permanent journals to ${JOURLAND_CONF}
        NEEDREBOOT=Y
     fi
  fi
  if [[ -f ${JOURLAND_CONF2} ]]; then
     if ! grep -q "^\#Storage=volatile" ${JOURLAND_CONF2}; then
        #echo sed -i "s/^\#*Storage=.*/\#Storage=volatile/" ${JOURLAND_CONF2}
        sed -i "s/^\#*Storage=.*/\#Storage=volatile/" ${JOURLAND_CONF2}
        echo Set permanent journals to ${JOURLAND_CONF2}
        NEEDREBOOT=Y
     fi
  fi
}

is_ELT07x5(){
   if ! ischroot; then
      [[ -c /dev/gpiochip0 ]] && CHIP=0
      [[ -c /dev/gpiochip512 ]] && CHIP=512
      if [[ -n ${CHIP} ]]; then
         if gpioget -v | grep gpioget | grep -q v1; then
            #echo gpio4=\$\(gpioget gpiochip${CHIP} 4\)
            gpio4=$(gpioget gpiochip${CHIP} 4)
         else
            #echo gpio4=\$\(gpioget -c gpiochip${CHIP} --numeric 4\)
            gpio4=$(gpioget -c gpiochip${CHIP} --numeric 4)
         fi
         #echo gpio4=${gpio4}
         [[ "${gpio4}" == "0" ]] && return 0
      fi
   fi
   return 1
}

check_boot_configiration(){
   echo '################################'
   if have_full; then
      echo 'CHECK BOOT CONFIGURATION'
   else
      echo 'REPLACE BOOT CONFIGURATION'
   fi
   echo '################################'

   ADD_GPIO_REBOOT=NO
   is_ELT07x5 && ADD_GPIO_REBOOT=YES
   #echo ADD_GPIO_REBOOT=${ADD_GPIO_REBOOT}

   configure_cmdline /boot
   configure_cmdline /boot/firmware

   if have_full; then
      do_configure_config /boot
      do_configure_config /boot/firmware
   else
      replace_config /boot
      replace_config /boot/firmware
   fi
   add_pps_module
   set_permanenet_journals
   #hciuart_enabled=$(systemctl is-enabled hciuart.service)
   #[[ "${hciuart_enabled}" != "disabled" ]] && [[ "${hciuart_enabled}" != "masked" ]] && systemctl disable hciuart
}

is_packet_not_installed(){
   instaled=`dpkg-query -l ${1} 2>/dev/null | grep ${1}|awk -F ' ' '{print $1}'`
   #echo 1=${1} instaled=${instaled}
   if [[ ${instaled} == "ii" ]]; then
      return 1
   fi
}

NEED_INSTALL=
install_packet_if_not_installed(){
   is_packet_not_installed ${1} && NEED_INSTALL="${NEED_INSTALL} ${1}"
   #echo NEED_INSTALL=${NEED_INSTALL} \$\1=${1}
}

check_platform(){
   platform=$(uname -m)
   if [[ ! ${platform} =~ 'aarch64' ]] && [[ ! ${platform} =~ 'armv7l' ]]; then
      echo ELT_RTKBase cannot be installed on ${platform} architecture
      exit 1
   fi
}

