install_rtklib() {
    echo '################################'
    echo 'INSTALLING RTKLIB'
    echo '################################'
    #echo mv ${BASEDIR}/${NMEACONF} ${LOCAL_BIN}
    mv ${BASEDIR}/${NMEACONF} ${LOCAL_BIN}
    ExitCodeCheck $?
    #echo chmod 711 ${LOCAL_BIN}/${NMEACONF}
    chmod 711 ${LOCAL_BIN}/${NMEACONF}
    ExitCodeCheck $?

    platform=$(uname -m)
    RTKLIB_DIR=${BASEDIR}/${RTKLIB}/${platform}
    if [[ -d ${RTKLIB_DIR} ]] && lsb_release -c | grep -q 'bookworm\|trixie'; then
       echo RtkLib copyed from ${RTKLIB_DIR}
       #echo chmod 711 ${RTKLIB_DIR}/*
       chmod 711 ${RTKLIB_DIR}/*
       ExitCodeCheck $?
       #echo mv ${RTKLIB_DIR}/* ${LOCAL_BIN}
       mv ${RTKLIB_DIR}/* ${LOCAL_BIN}
       ExitCodeCheck $?
    else
       echo RtkLib will be compiled from original and patches
       echo Get Rtklib 2.4.3 b34L release and unpack it
       sudo -u "${RTKBASE_USER}" wget -qO - https://github.com/rtklibexplorer/RTKLIB/archive/refs/tags/b34L.tar.gz | tar -xvz >/dev/null
       ExitCodeCheck $?
       #Install Rtklib app
       RTKLIB_CURDIR=`pwd`
       RTKLIB_GIT=${RTKLIB_CURDIR}/RTKLIB-b34L
       RTKLIB_PATCH=${BASEDIR}/${RTKLIB}
       doPatch ${RTKLIB_GIT}/src/stream.c ${RTKLIB_PATCH}/stream.patch
       doPatch ${RTKLIB_GIT}/src/streamsvr.c ${RTKLIB_PATCH}/streamsvr.patch
       doPatch ${RTKLIB_GIT}/src/rinex.c ${RTKLIB_PATCH}/rinex.patch
       doPatch ${RTKLIB_GIT}/src/rtkpos.c ${RTKLIB_PATCH}/rtkpos.patch
       doPatch ${RTKLIB_GIT}/src/ppp.c ${RTKLIB_PATCH}/ppp.patch
       doPatch ${RTKLIB_GIT}/src/rcv/septentrio.c ${RTKLIB_PATCH}/septentrio.patch
       doPatch ${RTKLIB_GIT}/src/rcv/unicore.c ${RTKLIB_PATCH}/unicore.patch
       doPatch ${RTKLIB_GIT}/app/consapp/str2str/str2str.c ${RTKLIB_PATCH}/str2str.patch
       doPatch ${RTKLIB_GIT}/app/consapp/str2str/gcc/makefile ${RTKLIB_PATCH}/str2str_makefile.patch
       doPatch ${RTKLIB_GIT}/app/consapp/convbin/gcc/makefile ${RTKLIB_PATCH}/convbin_makefile.patch
       doPatch ${RTKLIB_GIT}/app/consapp/rtkrcv/gcc/makefile ${RTKLIB_PATCH}/rtkrcv_makefile.patch
       #TODO add correct CTARGET in makefile?
       echo Compile and install Rtklib
       make -s --directory=${RTKLIB_GIT}/app/consapp/str2str/gcc
       ExitCodeCheck $?
       make -s --directory=${RTKLIB_GIT}/app/consapp/str2str/gcc install
       ExitCodeCheck $?
       make -s --directory=${RTKLIB_GIT}/app/consapp/rtkrcv/gcc
       ExitCodeCheck $?
       make -s --directory=${RTKLIB_GIT}/app/consapp/rtkrcv/gcc install
       ExitCodeCheck $?
       make -s --directory=${RTKLIB_GIT}/app/consapp/convbin/gcc
       ExitCodeCheck $?
       make -s --directory=${RTKLIB_GIT}/app/consapp/convbin/gcc install
       ExitCodeCheck $?
       #deleting RTKLIB
       rm -rf ${RTKLIB_GIT}

       echo Get ntripserver release and unpack it
       sudo -u "${RTKBASE_USER}" wget -qO - https://github.com/GNSSOEM/ntripserver/archive/refs/heads/main.tar.gz | tar -xvz >/dev/null
       ExitCodeCheck $?
       #Install ntripserver app
       NTRIPSERVER_CURDIR=`pwd`
       NTRIPSERVER_GIT=${NTRIPSERVER_CURDIR}/ntripserver-main
       echo Compile and install ntripserver
       make -s --directory=${NTRIPSERVER_GIT} install
       ExitCodeCheck $?
       #deleting ntripserver
       rm -rf ${NTRIPSERVER_GIT}
    fi
    #ls -la /usr/local/bin/
    #echo rm -rf ${BASEDIR}/${RTKLIB}
    rm -rf ${BASEDIR}/${RTKLIB}
    ExitCodeCheck $?
}

